// JavaScript for Fun AI Learning Adventure
// This file powers the math game, story adventure and drawing canvas.

// Wait for DOM content to load before attaching event listeners

/* === Math Adventure === */
function initMathGame() {
    const questionEl = document.getElementById('question');
    const answerInput = document.getElementById('answer');
    const submitBtn = document.getElementById('submit-answer');
    const resultEl = document.getElementById('result');

    let currentAnswer;

    // Function to generate a random math question
    function generateQuestion() {
        // Randomly choose addition or subtraction
        const operation = Math.random() < 0.5 ? '+' : '-';
        // Generate numbers between 0 and 20, ensure subtraction yields non-negative
        let a = Math.floor(Math.random() * 21);
        let b = Math.floor(Math.random() * 21);
        if (operation === '-' && b > a) {
            // swap to avoid negative answers for kids
            [a, b] = [b, a];
        }
        currentAnswer = operation === '+' ? a + b : a - b;
        questionEl.textContent = `${a} ${operation} ${b} = ?`;
        answerInput.value = '';
        resultEl.textContent = '';
    }

    // Handle answer submission
    submitBtn.addEventListener('click', () => {
        const userAnswer = parseInt(answerInput.value, 10);
        if (isNaN(userAnswer)) {
            resultEl.textContent = 'Please enter a number.';
            resultEl.style.color = '#cc3300';
            return;
        }
        if (userAnswer === currentAnswer) {
            resultEl.textContent = 'Great job! That’s correct!';
            resultEl.style.color = '#007700';
        } else {
            resultEl.textContent = `Oops! The correct answer was ${currentAnswer}. Try another!`;
            resultEl.style.color = '#cc3300';
        }
        // Generate a new question after a short delay
        setTimeout(generateQuestion, 2000);
    });

    // Generate first question
    generateQuestion();
}

/* === Story Adventure === */
function initStory() {
    const storyTextEl = document.getElementById('story-text');
    const storyOptionsEl = document.getElementById('story-options');

    // Define simple story nodes
    // Each node has an id, text and an array of options. Each option has text and nextId.
    const storyNodes = {
        start: {
            id: 'start',
            text: 'You wake up in a magical forest. You see a friendly dragon and a sparkling river. Who will you visit first?',
            options: [
                { text: 'Say hello to the dragon', nextId: 'dragon' },
                { text: 'Go explore the river', nextId: 'river' }
            ]
        },
        dragon: {
            id: 'dragon',
            text: 'The dragon smiles and offers you a ride through the sky! Do you hop on or ask for a treasure hunt instead?',
            options: [
                { text: 'Fly with the dragon', nextId: 'fly' },
                { text: 'Go on a treasure hunt', nextId: 'treasure' }
            ]
        },
        river: {
            id: 'river',
            text: 'At the river, a talking fish invites you to sing or splash. What do you choose?',
            options: [
                { text: 'Sing with the fish', nextId: 'sing' },
                { text: 'Splash in the water', nextId: 'splash' }
            ]
        },
        fly: {
            id: 'fly',
            text: 'You soar above the clouds and spot a rainbow. The dragon lands on a fluffy cloud where a cookie tree grows. Yum! The end.',
            options: []
        },
        treasure: {
            id: 'treasure',
            text: 'You and the dragon search for treasure. You find a chest filled with crayons and stickers! Time to get creative. The end.',
            options: []
        },
        sing: {
            id: 'sing',
            text: 'You sing a silly song with the fish and attract a troupe of dancing turtles. Everyone claps when you finish. The end.',
            options: []
        },
        splash: {
            id: 'splash',
            text: 'You splash in the sparkling river and discover colorful stones that look like jellybeans. You take some home. The end.',
            options: []
        }
    };

    let currentNodeId = 'start';

    // Render the current node
    function renderNode(nodeId) {
        const node = storyNodes[nodeId];
        storyTextEl.textContent = node.text;
        // Clear previous options
        storyOptionsEl.innerHTML = '';
        if (node.options && node.options.length > 0) {
            node.options.forEach(option => {
                const btn = document.createElement('button');
                btn.textContent = option.text;
                btn.className = 'story-option-button';
                btn.addEventListener('click', () => {
                    currentNodeId = option.nextId;
                    renderNode(currentNodeId);
                });
                storyOptionsEl.appendChild(btn);
            });
        } else {
            // If no options, show restart button
            const restartBtn = document.createElement('button');
            restartBtn.textContent = 'Play Again';
            restartBtn.className = 'story-option-button';
            restartBtn.addEventListener('click', () => {
                currentNodeId = 'start';
                renderNode(currentNodeId);
            });
            storyOptionsEl.appendChild(restartBtn);
        }
    }

    // Initialize the story
    renderNode(currentNodeId);
}

/* === Drawing Studio === */
function initDrawing() {
    const canvas = document.getElementById('drawing-canvas');
    const ctx = canvas.getContext('2d');
    const colorPicker = document.getElementById('color-picker');
    const brushSize = document.getElementById('brush-size');
    const clearBtn = document.getElementById('clear-canvas');

    let drawing = false;
    let lastX = 0;
    let lastY = 0;

    // Resize canvas for responsive design
    function resizeCanvas() {
        // Keep ratio while resizing to parent width
        const parentWidth = canvas.parentElement.clientWidth;
        // maintain 3:2 ratio (600x400 originally)
        canvas.width = Math.min(600, parentWidth);
        canvas.height = canvas.width * 2 / 3;
    }
    // Draw line from last position to current
    function draw(e) {
        if (!drawing) return;
        ctx.strokeStyle = colorPicker.value;
        ctx.lineWidth = brushSize.value;
        ctx.lineCap = 'round';
        const rect = canvas.getBoundingClientRect();
        const x = e.clientX - rect.left;
        const y = e.clientY - rect.top;
        ctx.beginPath();
        ctx.moveTo(lastX, lastY);
        ctx.lineTo(x, y);
        ctx.stroke();
        [lastX, lastY] = [x, y];
    }
    function startDrawing(e) {
        drawing = true;
        const rect = canvas.getBoundingClientRect();
        lastX = e.clientX - rect.left;
        lastY = e.clientY - rect.top;
    }
    function stopDrawing() {
        drawing = false;
    }
    // Clear canvas
    clearBtn.addEventListener('click', () => {
        ctx.clearRect(0, 0, canvas.width, canvas.height);
    });
    // Resize on load and window resize
    resizeCanvas();
    window.addEventListener('resize', resizeCanvas);
    // Attach mouse events
    canvas.addEventListener('mousedown', startDrawing);
    canvas.addEventListener('mousemove', draw);
    canvas.addEventListener('mouseup', stopDrawing);
    canvas.addEventListener('mouseleave', stopDrawing);
}